function isSerie(data) {
  var stringSerie = "series";
  var stringPack = "pack";
  var string = data.movie.ContentType;

  if (string.indexOf(stringSerie) !== -1 || string.indexOf(stringPack) !== -1) {
    return true;
  }

  return false;
} // Se verifica si es película, video o serie


